import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
} from 'react-router-dom';
import PagesPromotionSearch from "./Promotion/Search/Search";
import PagesPromotionForm from "./Promotion/Form/Form";

const Root = () => {
    return(
        <Router>
            <Switch>
                <Route path="/search" component={PagesPromotionSearch}/>
                <Route path="/update/:id" component={PagesPromotionForm}/>
                <Route path="/" component={PagesPromotionForm}/>
            </Switch>
        </Router>
    );
}

export default Root;
